function httpGetAsync(theUrl, callback) {
    var xmlHttp = new XMLHttpRequest();
    xmlHttp.onreadystatechange = function() {
        if (xmlHttp.readyState === 4) {
            const status = xmlHttp.status;
            if (status === 0 || (status >= 200 && status < 400)) {
                callback(xmlHttp.responseText);
            } else {
                writeToCustomConsole(`ERROR : ESP32 has not responded the GET request.`, true);
            }
        }
    }
    xmlHttp.onerror = function() {
        writeToCustomConsole(`ERROR : ESP32 has not responded the GET request. Check device IP`, true);
    }
    xmlHttp.open("GET", theUrl, true); // true for asynchronous 
    xmlHttp.send(null);
}

const handleFile = (e) => {
    const [file] = e.target.files;
    if (file) {
        const reader = new FileReader();

        reader.addEventListener("load", e => {
            const img = document.createElement("img");
            img.addEventListener("load", e => {
                const cvs = document.createElement("canvas");
                const ctx = cvs.getContext("2d");
                ctx.drawImage(img, 0, 0);
                const tmpArray = ctx.getImageData(0, 0, img.width, img.height);
                // console.log(tmpArray);
                const tmpPixelArray = [];
                for (let index = 0; index < tmpArray.data.length; index += 4) {
                    const red = tmpArray.data[index];
                    const green = tmpArray.data[index + 1];
                    const blue = tmpArray.data[index + 2];
                    const alpha = tmpArray.data[index + 3];

                    const avrgColor = (((red + green + blue) / 3) & 0xff);

                    tmpPixelArray.push('0x' + avrgColor.toString(16));
                }

                // divide image in lines of pixel based on its width and height
                // seem to have a problem as it generates black content
                const lines = [];
                for (let index = 0; index < tmpArray.height; index++) {
                    lines.push(tmpPixelArray.slice(index * tmpArray.width, (index * tmpArray.width) + tmpArray.width));
                }

                // recreate an array width the two images side by side
                // this is based on waht i understood of the original conversion of the image
                // as the assomption is probably wrong on how pixels a positioned in the array, this conversion is not working correctly
                let finalArray = []
                for (var i = 0; i < lines.length; i++) {
                    finalArray = [...finalArray, ...lines[i].filter((l, i) => i % 2 === 0)]; // for each line, take even elements and push them in new array
                    finalArray = [...finalArray, ...lines[i].filter((l, i) => i % 2 !== 0)]; // for each line, take odd elements and push them in new array
                }

                imgDataInput.value = JSON.stringify(finalArray);
                imgHeightInput.value = tmpArray.height;
                imgWidthInput.value = tmpArray.width;
                numberOfLinesInput.value = Math.floor(MAX_ELEMENT_PER_PAYLOAD / tmpArray.width);

                updateJsonPayloadImage();
                updateJsonPayloadWidth();
                updateJsonPayloadHeight();
                updateLinePerPayload();

                // console.log(json);
            });

            img.src = e.target.result
        }, false);

        reader.readAsDataURL(file);
    }
};

document.querySelector("input#img").addEventListener("change", handleFile);


